import React from 'react';
import './ItemJob.css';

function ItemJob(props) {
  return (
    <li className='OneJob'>

      <h2>{props.titulo}</h2>
      <h1>{props.tirulo}</h1>
      <h3>{props.ciudad}</h3>
      <p>{props.descripcion.slice(0, 250) + "..."}</p>
      <p>Experiencia: {props.añosDeExperiencia}</p>
    </li>
  );
}

export { ItemJob }
